export default function Admin(){
    return(
    <div
        className="container mt-4"
        style={{
          zIndex: 1,
          position: "relative",
          paddingBottom: "80px",
          paddingTop: "80px",
        }}
      >
         <div className="d-flex mt-3 justify-content-between align-items-center">
            <h4>Admin Dashboard</h4>
            
         <div>
            <button className="btn btn-block button-style">Add Product</button>
            </div>
        </div>

        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Quantity</th>
                    <th>Category</th>
                    <th>Price</th>
                    <th></th>
                    <th></th>
                </tr>
            </thead>
        </Table>
    
 </div>
      
    );
}
